import React, { useEffect, useState } from 'react'
import { useForm } from 'react-hook-form'
import axios from 'axios'
import { getAllBrand, storeBrand } from '../../API/ApiBrand'

export default function Brand_Page() {
    const [privewImage, setPrivewImage] = useState("https://1000logos.net/wp-content/uploads/2021/11/Nike-Logo-tumb.jpg")
    const [imageUpload, setImageUpload] = useState()
    const [brands, setBrands] = useState([])
    const {
        register,
        handleSubmit,
        formState: { error }
    } = useForm()
    useEffect(() => {

    }, [])
    const loadBrands = async () => {
        const result = await getAllBrand()
        
    }
    const handlePost = async (data) => {
        const image = new FormData()
        image.append("file", imageUpload)
        image.append("cloud_name", "dswqplrdx")
        image.append("upload_preset", "qh49wlsn")
        const response = await axios.post("https://api.cloudinary.com/v1_1/dswqplrdx/image/upload", image)
        const result = {
            urlLogo: response.data.url,
            name: data.name
        }
        try {
            console.log(result);
            await storeBrand(result)
        } catch (error) {
            throw error
        }
    }
    const onChangeImage = (e) => {
        setImageUpload(e.target.files[0])
        setPrivewImage(URL.createObjectURL(e.target.files[0]))
    }
    return (
        <div className='container'>
            <h1 className='text-center text-secondary text-uppercase'>Brand Management</h1>
            <div className='text-center'>
                <img src={privewImage} style={{ width: '100px' }} className="img-thumbnai" alt="..." />
            </div>
            <form onSubmit={handleSubmit(handlePost)} className='row text-start m-5'>
                <div className='col-4'>
                    <input
                        className="form-control"
                        type="file"
                        onChange={onChangeImage}
                    />
                </div>
                <div className='col-6'>
                    <input type="text" className="form-control" placeholder="Brand name" {...register("name", { required: true })} />
                </div>
                <div className='col-2'>
                    <button onClick={handleSubmit} className='btn btn-secondary'>Create</button>
                </div>
            </form>
            <table className="table">
                <thead>
                    <tr>
                        <th scope="col">No</th>
                        <th scope="col">Logo</th>
                        <th scope="col">Brand</th>
                        <th scope="col">Action</th>
                    </tr>
                </thead>
                <tbody>
                    <tr className='justify-content-center'>
                        <th scope="row">1</th>
                        <td>
                            <img src="https://1000logos.net/wp-content/uploads/2021/11/Nike-Logo-tumb.jpg" className="img-thumbnail border-0" alt="..." style={{ width: '100px' }} />
                        </td>
                        <td>Nike</td>
                        <td>
                            <button className='btn btn-outline-warning m-2'>Edit</button>
                            <button className='btn btn-outline-danger'>Delete</button>
                        </td>
                    </tr>
                </tbody>
            </table>
        </div>
    )
}
